import Carousel from "react-multi-carousel";
import "react-multi-carousel/lib/styles.css";
import "./slider.css";

export default function Slider() {
    const responsive = {
        desktop: {
            breakpoint: {max: 3000, min: 1024},
            items: 3,
            slidesToSlide: 3 // optional, default to 1.
        },
        tablet: {
            breakpoint: {max: 1024, min: 464},
            items: 2,
            slidesToSlide: 2 // optional, default to 1.
        },
        mobile: {
            breakpoint: {max: 464, min: 0},
            items: 1,
            slidesToSlide: 1 // optional, default to 1.
        }
    };

    return (
        <Carousel responsive = {responsive}
                  draggable = {false}
                  swipeable = {true}
                  infinite = {false}
                  ssr = {true}
                  showDots = {false}
                  centerMode = {true}
                  className = "carousalContainer"
        >
            <div className = "trendingCards">
                <img
                    src = "https://images.unsplash.com/photo-1612815867823-85cf0957890b?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=774&q=80"
                    alt = "TrendingImage"
                    className = "trImg" />

                <div className = "trDesc">
                    <p>climateChange</p>
                    <p className = "caption">
                        Scientists identify the most extreme heatwa...
                    </p>
                    <small>2 hours ago</small>
                </div>
            </div>
            {/*<div className = "trendingCards">Item 2</div>*/}
            {/*<div className = "trendingCards">Item 3</div>*/}
            {/*<div className = "trendingCards">Item 4</div>*/}
        </Carousel>
    )
}
